import {contact} from "../Contact";
function Card(props){
    return( <div>
    <h1 className="heading">My Contacts</h1>
    <div className="card">
        <h1 >{props.name}</h1>
        <img
           src={props.img}
          />
        <p>{props.number}</p>
        <p>{props.email}</p>
        </div>
    </div>
    )
}

export default Card;
